script: |
  super -f text -I q6958.spq | sort > q6958.out

inputs:
  - name: q6958.spq
    data: |
      SELECT SUM ( col1 ) + + ( + COUNT ( * ) ) FROM tab0 (FORMAT parquet) AS cor0 WHERE col1 BETWEEN + - 79 * + + col0 + - 78 AND + ( col0 ) * col1;
  - name: tab0

outputs:
  - name: q6958.out
    data: |
      106
